eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (__WEBPACK_DEFAULT_EXPORT__)\n/* harmony export */ });\nconst noticias = [\n    {\n        \"titulo\": \"Maioria dos brasileiros mergulha no universo dos games em 2023\",\n        \"texto\": \"A Pesquisa Game Brasil (PGB) de 2023 mostra que o engajamento com os jogos eletrônicos é altíssimo no país. Segundo os dados, 82,1% dos jogadores afirmam que os games são uma das principais formas de lazer. O smartphone segue como plataforma preferida, com 51,7% da preferência, enquanto consoles e computadores vêm em seguida.\\n\\nO estudo também revelou dados sobre o perfil dos jogadores: 53,8% são homens, e 46,2% são mulheres. Além disso, 54,1% dos gamers se identificam como pardos ou pretos. Os eSports seguem em alta, conhecidos por 82,9% dos jogadores e praticados por quase metade deles. E mais: 58,3% dos entrevistados acreditam que a indústria de jogos no Brasil pode oferecer boas oportunidades de carreira.\",\n        \"imagem\": \"../images-news/universo-gamer.webp\"\n    },\n    {\n        \"titulo\": \"Assinatura da PS Plus terá reajuste de até 37% ainda em abril no Brasil\",\n        \"texto\": \"A Sony confirmou que o valor da assinatura da PS Plus vai subir no Brasil ainda em abril de 2025. O aumento pode chegar a até 37%, dependendo do plano escolhido. A empresa afirma que o reajuste está relacionado à adaptação de preços regionais e à tentativa de manter a qualidade do serviço, que inclui jogos mensais gratuitos, acesso ao multiplayer online e descontos exclusivos.\\n\\nOs novos valores já foram disponibilizados no site oficial da PlayStation e impactam diretamente quem pretende renovar ou assinar o serviço nos próximos dias. Para muitos usuários, o reajuste reacende o debate sobre o custo-benefício da assinatura.\",\n        \"imagem\": \"../images-news/female-playing.webp\"\n    },\n    {\n        \"titulo\": \"Nintendo Switch 2 no Brasil: tudo sobre o lançamento e preço oficial\",\n        \"texto\": \"A Nintendo confirmou oficialmente que o Switch 2 será lançado no Brasil, com previsão para o segundo semestre de 2025. O novo console promete melhorias gráficas, maior desempenho e compatibilidade com a biblioteca atual de jogos.\\n\\nO preço sugerido no país ainda não foi revelado, mas rumores indicam que deve girar em torno de R$ 3.000 a R$ 3.500, considerando taxas e impostos. A expectativa é grande, e fãs aguardam ansiosamente por mais detalhes sobre os títulos de lançamento e funcionalidades inéditas.\",\n        \"imagem\": \"../images-news/nitendo.webp\"\n    },\n    {\n        \"titulo\": \"GameSir X2 promete revolucionar a jogatina mobile\",\n        \"texto\": \"O GameSir X2, controle estilo gamepad para smartphones, está chamando atenção por entregar uma experiência de console direto na palma da mão. Compatível com Android e iOS, ele oferece conforto, precisão e suporte a serviços como Xbox Cloud Gaming, GeForce NOW e até emuladores.\\n\\nCom design ajustável, botões responsivos e baixa latência, o acessório promete transformar o jeito como os jogadores encaram os games mobile. Ideal para quem busca mais controle e menos frustração nas partidas pelo celular.\",\n        \"imagem\": \"../images-news/game-sir.webp\"\n    },\n    {\n        \"titulo\": \"Videogames podem transformar seu cérebro e ajudar no TDAH, dizem estudos\",\n        \"texto\": \"A psicologia tem investigado o impacto dos games no cérebro e traz conclusões surpreendentes: jogar videogame pode ajudar no desenvolvimento de certas habilidades cognitivas, e inclusive beneficiar pessoas com Transtorno de Déficit de Atenção e Hiperatividade (TDAH).\\n\\nEstudos mostram que jogos de ação e estratégia melhoram o foco, a tomada de decisão e a memória operacional. Para quem tem TDAH, os games podem atuar como ferramentas terapêuticas, ajudando na autorregulação e na motivação. Claro, tudo com moderação e acompanhamento profissional.\",\n        \"imagem\": \"../images-news/ajuda-tdah.webp\"\n    },\n    {\n        \"titulo\": \"Conheça os maiores eventos gamers do Brasil\",\n        \"texto\": \"O Brasil se firmou de vez como uma potência no mundo gamer, e os eventos dedicados a jogos eletrônicos são prova disso. Com feiras gigantescas e encontros regionais cada vez mais populares, o calendário brasileiro está recheado de oportunidades para fãs, profissionais e criadores se conectarem.\\n\\nEntre os destaques está a Brasil Game Show (BGS), o maior evento do tipo na América Latina, além do BIG Festival, focado em games independentes e inovação. Eventos como Game XP e Campus Party também completam esse ecossistema, mostrando que o Brasil está no centro do radar gamer mundial.\",\n        \"imagem\": \"../images-news/eventos-gamer.webp\"\n    },\n    {\n        \"titulo\": \"Estudo sugere que Inteligências Artificiais podem manifestar sinais de estresse\",\n        \"texto\": \"Parece ficção científica, mas é ciência: estudos apontam que certos sistemas de inteligência artificial podem apresentar comportamentos instáveis quando submetidos a sobrecarga de informações. Essa condição, apelidada de 'estresse algorítmico', levanta discussões sobre os limites da IA em ambientes críticos, como saúde e transporte.\\n\\nAinda que máquinas não sintam emoções, compreender como reagem sob pressão é fundamental para sua aplicação segura no mundo real.\",\n        \"imagem\": \"../images-news/estado-IA.webp\"\n    },\n    {\n        \"titulo\": \"Ser educado com IA custa mais? Pesquisadores debatem impacto da cordialidade\",\n        \"texto\": \"Pedir algo com 'por favor' para a IA pode ser fofo, mas será que sai mais caro? Um novo estudo analisa se interações mais longas e educadas aumentam o tempo de processamento e o uso de energia nos servidores que alimentam assistentes virtuais. Embora o impacto individual seja pequeno, em grande escala, isso pode representar custos maiores.\\n\\nApesar disso, especialistas lembram que gentileza, mesmo digital, é sempre bem-vinda.\",\n        \"imagem\": \"../images-news/IA.webp\"\n    },\n    {\n        \"titulo\": \"Por que crianças são tão fascinadas por Minecraft? Psicologia explica\",\n        \"texto\": \"Minecraft pode parecer um jogo simples à primeira vista, mas sua popularidade entre crianças tem raízes profundas. Psicólogos apontam que o jogo promove autonomia, criatividade e senso de conquista, pilares essenciais no desenvolvimento infantil.\\n\\nA liberdade para explorar, construir e experimentar ativa o sistema de recompensa do cérebro. Além disso, a ausência de objetivos fixos permite que cada criança molde sua própria narrativa, fazendo de Minecraft um verdadeiro playground digital.\",\n        \"imagem\": \"../images-news/mine.webp\"\n    },\n    {\n        \"titulo\": \"Filme live-action de 'Invencível' continua nos planos, garante produtor\",\n        \"texto\": \"Seth Rogen confirmou que o filme de 'Invencível' com atores ainda está em desenvolvimento. A produção busca oferecer uma experiência diferente da série animada, explorando novas abordagens para o universo do herói Mark Grayson.\\n\\nSem data de estreia confirmada, o projeto segue ativo, com a promessa de surpreender os fãs com algo épico e inesperado.\",\n        \"imagem\": \"../images-news/Invenciveis-live.webp\"\n    },\n    {\n        \"titulo\": \"Jogos em mídia física para PS5 e Switch entram em promoção na Amazon\",\n        \"texto\": \"Se você ainda curte ter caixinha na estante e não abre mão dos jogos físicos, essa é a hora! A Amazon lançou uma nova rodada de promoções com descontos em jogos para PlayStation 5 e Nintendo Switch. Títulos populares e lançamentos recentes estão com preços reduzidos por tempo limitado.\\n\\nEntre os destaques estão aventuras aclamadas, RPGs e jogos de ação que podem ser adquiridos com até 40% de desconto. A ação faz parte de uma série de ofertas relâmpago da loja, voltadas para colecionadores e jogadores que preferem mídia física.\\n\\nÉ uma excelente chance de expandir sua biblioteca sem esvaziar o bolso. Mas corre, porque os estoques variam de acordo com a demanda!\",\n        \"imagem\": \"../images-news/jogos-midia-fisica.webp\"\n    },\n    {\n        \"titulo\": \"Final de The Last of Us Parte II: entenda o desfecho impactante do jogo\",\n        \"texto\": \"The Last of Us Parte II dividiu opiniões e emocionou milhões de jogadores com seu final poderoso e cheio de camadas. O jogo leva os personagens Ellie e Abby a um confronto inevitável, repleto de dor, perdas e dilemas morais.\\n\\nSem entregar todos os spoilers, o desfecho mostra Ellie em um momento de ruptura emocional, questionando o ciclo de vingança que a levou tão longe. A escolha final da personagem diz muito sobre arrependimento, humanidade e as cicatrizes que sobrevivem mesmo quando a guerra acaba.\\n\\nA narrativa ousada do game foi elogiada por sua profundidade e complexidade, consolidando a Naughty Dog como referência em storytelling nos videogames.\",\n        \"imagem\": \"../images-news/the-last-of-us.webp\"\n    },\n    {\n        \"titulo\": \"Novidades no catálogo do Game Pass: confira os jogos recém-adicionados\",\n        \"texto\": \"O Xbox Game Pass não para! A Microsoft atualizou o catálogo do serviço e trouxe uma nova leva de jogos para quem curte variedade e qualidade. Entre os títulos recém-chegados estão jogos de ação, aventura, indie e até simuladores que prometem prender sua atenção por horas.\\n\\nA assinatura, que dá acesso a centenas de games por um valor mensal fixo, segue como uma das melhores opções custo-benefício do mundo gamer. Os novos jogos já estão disponíveis para download no console, PC e nuvem (xCloud), dependendo do plano.\\n\\nSe você é assinante, vale a pena conferir a lista completa e experimentar algo novo hoje mesmo.\",\n        \"imagem\": \"../images-news/gamepass.webp\"\n    },\n    {\n        \"titulo\": \"Pokémon TCG anuncia nova expansão inspirada na região de Alola\",\n        \"texto\": \"Os fãs de Pokémon TCG já podem se preparar: uma nova expansão está a caminho e será baseada na adorada região de Alola. A novidade foi anunciada oficialmente pela The Pokémon Company e trará criaturas icônicas da sétima geração em novas cartas colecionáveis e mecânicas atualizadas.\\n\\nA expansão promete destacar os Pokémon em suas formas regionais, além de introduzir novos tipos de energia e combinações estratégicas para jogadores competitivos. Como sempre, também haverá boosters temáticos e decks prontos para quem está começando.\\n\\nO lançamento está previsto para os próximos meses e deve movimentar tanto o cenário casual quanto os torneios oficiais do TCG.\",\n        \"imagem\": \"../images-news/pokemom-tcg.webp\"\n    },\n    {\n        \"titulo\": \"Confira os jogos já confirmados para a gamescom latam 2025\",\n        \"texto\": \"A primeira edição da gamescom latam, marcada para 2025 em São Paulo, já começou a agitar o calendário gamer com uma lista de jogos confirmados que promete agradar fãs de todos os estilos. \\n\\nEstúdios independentes e grandes publishers trarão demos jogáveis, trailers inéditos e experiências imersivas durante o evento. Entre os destaques estão produções brasileiras, títulos internacionais aguardados e projetos em realidade virtual.\\n\\nA gamescom latam pretende ser um novo marco na cena de games da América Latina, e os anúncios iniciais já mostram que vem coisa grande por aí!\",\n        \"imagem\": \"../images-news/gamescom.webp\"\n    },\n    {\n        \"titulo\": \"SEGA, Bandai Namco e Arc System Works confirmadas na gamescom latam 2025\",\n        \"texto\": \"A gamescom latam 2025 promete ser histórica! Três gigantes japonesas — SEGA, Bandai Namco e Arc System Works — confirmaram presença no evento e devem trazer grandes novidades para os fãs latino-americanos.\\n\\nA expectativa é de que títulos como Tekken 8, Persona, Guilty Gear e possíveis surpresas da franquia Sonic estejam no radar das apresentações. A presença dessas empresas reforça o peso internacional do evento, que será sediado em São Paulo.\\n\\nAlém de stands interativos, painéis com desenvolvedores e campeonatos de eSports estão previstos. Vai ser o momento ideal pra quem quer sentir de perto o que há de mais quente no mundo dos games.\",\n        \"imagem\": \"../images-news/sega.webp\"\n    }\n];\n/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = (noticias);\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./src/data/news.js\n");

